description:
Category	Legal Teen, Feature, College Girls

Starring	Lexi Belle, Dani Daniels, Maddy O'Reilly, Anikka Albrite, Keisha Grey, Ash Hollywood, Lezley Zen, Jynx Maze, AJ Applegate, Yurizan Beltran, Mercedes Carrera, Ryan Ryans, Ana Foxxx

The ladies of sorority Delta Pi Chi just moved into the neighborhood and the community is not thrilled! These sex-crazed sorority sisters party loud and screw louder with the fraternities without any consideration for their neighbors! Rush just started and a handful of horny freshman girls are eagerly waiting to pledge. The hazing gets kinky and the girls are constantly dropping to their knees to please, but it all pays off when the last ceremony, an all-girl orgy, seals them to the Sisterhood! President Bella has one last party to throw, but if the girls get one more complaint, Delta Pi Chi is out. To ensure their fun, she'll have to go deep into the system and sort things out!
